import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Player List</h1>
      <ul>
        <li>Alice - 123-456-7890</li>
        <li>Bob - 234-567-8901</li>
        <li>Charlie - 345-678-9012</li>
      </ul>
      <div>
        <input type="text" name="name" placeholder="Enter player's name" value="" />
        <input type="text" name="phoneNumber" placeholder="Enter player's phone number" value="" />
        <button>Add Player</button>
      </div>
      <h1>Tennis Scheduler</h1>
      <p>Current Player: Alice</p>
      <button>Select Next Player</button>
    </div>
  );
}

export default App;
